import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible and click to focus
    await page.waitForSelector('#eventSearchInput');
    await page.click('#eventSearchInput');

    // Take screenshot after focusing on the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_focused_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_focused_search_input.png'));

    return {
      success: true,
      action: "Focused on the search input field",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

